import React from 'react';

function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <img src="/logo.png" alt="Logo" style={{ width: 150 }} />
      <h1>Bid Email Classifier</h1>
    </div>
  );
}

export default App;
